message.xnet.antenna:
\
    @fPlace one or two antenna's on\n\
    @ftop of an antenna base.\n\
    @6One: range %s (%s rf/t/channel)\n\
    @6Two: range %s (%s rf/t/channel)

message.xnet.antenna_base:
\
    @fAn antenna base has to be placed\n\
    @fon top of a wireless router

message.xnet.antenna_dish:
\
    @fAn antenna dish has to be placed\n\
    @fon top of an antenna base and\n\
    @fallows very extreme wireless range\n\
    @6(%s rf/t/channel)
